import UserListItem from "./UserListItem";
import Card from "../UI/Card";

function UserList(props){
    return (
        <Card>
            <ul>
                {props.usersList.map(user => <UserListItem>
                    key = {user.id}
                    username = {user.username}
                    age = {user.age}
                </UserListItem>)}
            </ul>
        </Card>
    );
}

export default UserList;
